import React from "react";
import './style.css';

// 위스키 리스트 컴포넌트
export default function WhiskyItem() {

    // 위스키 리스트 컴포넌트 렌더링
    return (
        <div className='whisky-item'>
            <div className='whisky-item-main-box'>
                <div className='whisky-item-left'>
                    <div className='whisky-item-image' style={{ backgroundImage: 'url()'}}></div>
                </div>
                <div className='whisky-item-center'>
                        <div className='whisky-item-title'>{'확인3'}</div>
                        <div className='whisky-item-content'>{'확인1'}</div>
                </div>
                <div className='whisky-item-right'>
                    <div className='whisky-item-counts'>{'댓좋조구독'}</div>
                </div>
            </div>
        </div>
    )
}
